INSERT INTO `explorer_query` VALUES (1,'C OLIMPO Retiros y depositos por mes   OK','SELECT nombre,\r\n       cuenta,\r\n       date_format(fecha,\'%m-%Y\') AS mes,\r\n       MIN(olimpo_movimiento.FECHA) AS fec_ini,\r\n       MAX(olimpo_movimiento.FECHA) AS fec_fin,\r\n       SUM(olimpo_movimiento.deposito) AS depositos,\r\n       SUM(olimpo_movimiento.retiro) AS retiros,\r\n       sum(deposito) - sum(retiro) AS diferencia\r\nFROM olimpo_movimiento,\r\n     olimpo_cuenta_banco,\r\n     periodo,\r\n     condominio\r\nWHERE olimpo_cuenta_banco.id = olimpo_movimiento.cuenta_banco_id\r\n  AND FECHA >= periodo.fecha_inicial\r\n  AND FECHA <= periodo.fecha_final\r\n  AND olimpo_cuenta_banco.condominio_id = periodo.condominio_id\r\n  AND olimpo_cuenta_banco.condominio_id = condominio.id\r\nGROUP BY 1,\r\n         2,\r\n         3','Olimpo, Retiros y Depositos por cuenta y mes','2017-11-29 01:21:57.970624','2018-08-25 04:33:24.969615',1,0),(2,'C OLIMPO Detalle de ingresos y egresos OK','select c.num_cuenta AS CUENTA, c.descripcion AS DESCRIPCION, sum(dm.monto) AS MONTO \r\nfrom cuenta_contable c, olimpo_detalle_movimiento dm\r\nwhere c.id = dm.cuenta_contable_id\r\nand movimiento_id in (\r\n  		select m.id\r\n        from olimpo_movimiento m, periodo p, condominio c\r\n        where m.fecha >= fecha_inicial\r\n        and   m.fecha <= fecha_final\r\n        and   p.condominio_id = c.id\r\n        and   c.nombre = \'OLIMPO\' )\r\nGROUP BY 1,2\r\nORDER BY 1 ','Desgloce de los ingresos del condominio en un periodo determinado','2017-11-29 02:14:19.554541','2018-08-09 19:24:04.838815',1,0),(3,'OLIMPO Depositos por departamento','select  cb.clabe, m.fecha, concat(tm.descripcion,\' \',m.descripcion) as Concepto, m.deposito,\r\n        case when deposito = sum(dm.monto) then \'SI\' else \'NO\' end as conciliado,\r\n        deposito - sum(dm.monto) as diferencia\r\nfrom olimpo_detalle_movimiento dm, condominio co,\r\n     olimpo_condomino d, olimpo_movimiento m, periodo p, \r\n     olimpo_cuenta_banco cb, tipo_movimiento tm\r\nwhere m.id = dm.movimiento_id\r\nand   m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   cb.condominio_id = co.id\r\nand   m.tipo_movimiento_id = tm.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = \'A303\'\r\ngroup by 1,2,3,4\r\norder by 2','Adeudos por departamento','2017-12-01 01:03:12.316361','2018-02-13 01:20:10.274005',1,0),(4,'Asientos depto detalle','select m.fecha, c.num_cuenta as Cuenta, c.descripcion as Descripcion, debe as Debe, haber as Haber\r\nfrom cuenta_contable c, condominio co,\r\n     olimpo_condomino d, olimpo_asiento m, periodo p\r\nwhere m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = \'B107\'\r\nand   m.cuenta_contable_id = c.id\r\norder by 1','','2017-12-01 01:09:08.081858','2018-08-09 18:36:02.312730',1,0),(5,'OLIMPO Cuotas por departamento','select c.num_cuenta as Cuenta, c.descripcion as Descripcion, \r\n       min(fecha) as inicio, max(fecha) as final,\r\n       sum(haber) as Debe, sum(debe) as Haber\r\nfrom cuenta_contable c, condominio co,\r\n     olimpo_condomino d, olimpo_asiento m, periodo p\r\nwhere m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = $$depto$$\r\nand   m.cuenta_contable_id = c.id\r\ngroup by 1,2\r\nunion \r\nselect c.num_cuenta as Cuenta, c.descripcion as Descripcion, \r\n       min(fecha) as inicio, max(fecha) as final,\r\n       0 as Debe, sum(dm.monto) as Haber\r\nfrom cuenta_contable c, olimpo_detalle_movimiento dm, condominio co,\r\n     olimpo_condomino d, olimpo_movimiento m, periodo p\r\nwhere c.id = dm.cuenta_contable_id\r\nand   m.id = dm.movimiento_id\r\nand   m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = $$depto$$\r\ngroup by 1,2\r\norder by 1,2','Adeudo de las cuotas por departamento y pago de las mismas en un periodo de tiempo determinado','2017-12-01 01:13:10.954606','2018-08-25 17:49:46.169378',1,0),(6,'detalle depositos depto','select c.clave_mayor as Clave, m.fecha as Fecha, dm.descripcion as Descripcion, \r\n       c.descripcion, dm.monto as Deposito\r\nfrom cuenta_contable c, olimpo_detalle_movimiento dm, condominio co,\r\n     olimpo_condomino d, olimpo_movimiento m, periodo p\r\nwhere c.id = dm.cuenta_contable_id\r\nand   m.id = dm.movimiento_id\r\nand   m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = \'B107\'\r\norder by 2','detalle depsitos depto','2017-12-03 22:38:11.559127','2018-02-13 01:22:13.587529',1,0),(7,'REPORTE DETALLE OLIMPO depto','select c.num_cuenta as Cuenta, m.descripcion as Descripcion, \r\n       fecha as inicio,\r\n       haber as Debe, debe as Haber, concat(t.descripcion,\'\') as Concepto, 0 as Deposito\r\nfrom cuenta_contable c, condominio co,\r\n     olimpo_condomino d, olimpo_asiento m, periodo p, tipo_movimiento t\r\nwhere m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = \'A202\'\r\nand   m.cuenta_contable_id = c.id\r\nand   t.id = m.tipo_movimiento_id\r\nunion \r\nselect c.num_cuenta as Cuenta, dm.descripcion as Descripcion, \r\n       fecha as inicio, \r\n       0 as Debe, dm.monto as Haber, concat(t.descripcion,\' \',m.descripcion)  as Concepto, m.deposito as Deposito\r\nfrom cuenta_contable c, olimpo_detalle_movimiento dm, condominio co,\r\n     olimpo_condomino d, olimpo_movimiento m, periodo p, tipo_movimiento t\r\nwhere c.id = dm.cuenta_contable_id\r\nand   m.id = dm.movimiento_id\r\nand   m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'OLIMPO\'\r\nand   d.depto = \'A202\'\r\nand   t.id = m.tipo_movimiento_id\r\norder by 3,1','','2017-12-04 00:02:09.564633','2018-02-13 01:20:39.969174',1,0),(8,'C OLIMPO Quien deposito en el periodo ?','SELECT $$mes$$ AS MES,\r\n       nombre AS CONDOMINIO,\r\n       depto AS DEPTO,\r\n       propietario AS PROPIETARIO,\r\n       sum(deposito) AS DEPOSITO\r\nFROM olimpo_movimiento,\r\n     olimpo_cuenta_banco,\r\n     olimpo_condomino,\r\n     condominio\r\nWHERE olimpo_movimiento.cuenta_banco_id = olimpo_cuenta_banco.id\r\n  AND date_format(fecha,\'%m-%Y\') = $$mes$$\r\n  AND olimpo_condomino.id = olimpo_movimiento.condomino_id\r\n  AND olimpo_condomino.depto != \'0000\'\r\n  AND condominio.nombre = \'OLIMPO\'\r\n  AND deposito > 0\r\nGROUP BY 1,\r\n         2,\r\n         3,\r\n         4\r\nUNION\r\nSELECT $$mes$$ AS MES,\r\n       nombre AS CONDOMINIO,\r\n       depto AS DEPTO,\r\n       propietario AS PROPIETARIO,\r\n       0 AS DEPOSITO\r\nFROM olimpo_condomino,\r\n     condominio\r\nWHERE olimpo_condomino.condominio_id = condominio.id\r\n  AND depto NOT IN\r\n    (SELECT depto\r\n     FROM olimpo_movimiento,\r\n          olimpo_cuenta_banco,\r\n          olimpo_condomino\r\n     WHERE olimpo_movimiento.cuenta_banco_id = olimpo_cuenta_banco.id\r\n       AND olimpo_condomino.id = olimpo_movimiento.condomino_id\r\n       AND olimpo_condomino.depto != \'000\'\r\n       AND date_format(fecha,\'%m-%Y\') = $$mes$$\r\n       AND deposito > 0)\r\n  AND depto != \'0000\'\r\n  AND condominio.nombre = \'OLIMPO\'\r\nORDER BY depto','Relacin de departamentos que depositaron en el periodo, solo presenta: Mes, Departamento y Deposito','2017-12-12 00:33:48.123645','2018-06-04 23:35:15.531904',1,0),(9,'C OLIMPO Departamentos sin deposito en el mes','SELECT $$mes$$ AS MES,\r\n       nombre AS CONDOMINIO,\r\n       depto AS DEPTO,\r\n       propietario AS PROPIETARIO,\r\n       0 AS DEPOSITO\r\nFROM olimpo_condomino,\r\n     condominio\r\nWHERE olimpo_condomino.condominio_id = condominio.id\r\n  AND depto NOT IN\r\n    (SELECT depto\r\n     FROM olimpo_movimiento,\r\n          olimpo_cuenta_banco,\r\n          olimpo_condomino\r\n     WHERE olimpo_movimiento.cuenta_banco_id = olimpo_cuenta_banco.id\r\n       AND olimpo_condomino.id = olimpo_movimiento.condomino_id\r\n       AND olimpo_condomino.depto != \'0000\'\r\n       AND date_format(fecha,\'%m-%Y\') = $$mes$$\r\n       AND deposito > 0)\r\n  AND depto != \'0000\'\r\n  AND condominio.nombre = \'OLIMPO\'\r\nORDER BY depto','Departamentos que no depositaron en el mes','2017-12-12 01:15:26.774335','2018-07-08 20:01:39.852447',1,0),(10,'inconsistencias cuentas','SELECT m.id, m.descripcion, d.descripcion, c.num_cuenta, c.descripcion\r\nFROM olimpo_movimiento m, olimpo_detalle_movimiento d, cuenta_contable c\r\nWHERE m.id = d.movimiento_id\r\nand d.cuenta_contable_id = c.id\r\nand m.fecha >= \'2018-04-01\'\r\nand m.fecha <= \'2018-04-30\'\r\norder by 4','','2018-02-13 01:29:13.052490','2018-06-04 19:37:22.604548',1,0),(11,'pagos terraza','SELECT con.depto, c.descripcion, sum(d.monto)\r\nFROM olimpo_movimiento m, olimpo_detalle_movimiento d, cuenta_contable c, olimpo_condomino con\r\nWHERE m.id = d.movimiento_id\r\nand d.cuenta_contable_id = c.id\r\nand m.fecha >= \'2017-11-01\'\r\nand m.fecha <= \'2018-07-31\'\r\nand c.num_cuenta = \'411202\'\r\nand con.id = m.condomino_id\r\ngroup by 1,2\r\norder by 1','','2018-02-13 03:21:09.949047','2018-08-10 00:08:25.266603',1,0),(12,'Cuotas DeptoMes SADICARNOT OK','SELECT date_format(fecha,\'%m-%Y\') as MES,\r\n                           nombre as CONDOMINIO,\r\n                           depto as DEPTO,\r\n                           propietario as PROPIETARIO,\r\n                           sum(deposito) as DEPOSITO\r\n                    FROM sadi_movimiento, sadi_cuenta_banco, sadi_condomino, condominio\r\n                    WHERE sadi_movimiento.cuenta_banco_id = sadi_cuenta_banco.id\r\n                          and date_format(fecha,\'%m-%Y\') = \'05-2018\'\r\n                          and sadi_condomino.id = sadi_movimiento.condomino_id\r\n                          and sadi_condomino.depto != \'0000\'\r\n                          and condominio.nombre = \'SADICARNOT\'\r\n                          and deposito > 0\r\n                    GROUP by 1,2,3,4\r\n                    UNION\r\n                    SELECT \'04-2018\' as MES,\r\n                           nombre as CONDOMINIO,\r\n                           depto as DEPTO,\r\n                           propietario AS PROPIETARIO,\r\n                           0 AS DEPOSITO\r\n                    FROM sadi_condomino, condominio\r\n                    WHERE sadi_condomino.condominio_id = condominio.id\r\n                          and depto NOT IN\r\n                             (SELECT depto\r\n                              FROM sadi_movimiento,\r\n                                   sadi_cuenta_banco,\r\n                                   sadi_condomino\r\n                              WHERE sadi_movimiento.cuenta_banco_id = sadi_cuenta_banco.id\r\n                              AND sadi_condomino.id = sadi_movimiento.condomino_id\r\n                              AND sadi_condomino.depto != \'0000\'\r\n                              AND date_format(fecha,\'%m-%Y\') = \'05-2018\'\r\n                              AND deposito > 0)\r\n                     AND depto != \'0000\'  \r\n                     AND condominio.nombre = \'SADICARNOT\'     \r\n                     ORDER BY depto','Cuotas DeptoMes SADICARNOT','2018-03-07 05:26:32.996547','2018-07-16 17:15:19.790309',1,0),(13,'Ingresos Egresos Por Mes SadiCarnot 10 OK','SELECT nombre AS CONDOMINIO,\r\n       clabe AS CUENTA,\r\n       date_format(fecha,\"%m-%Y\") as MES,\r\n       MIN(sadi_movimiento.FECHA) AS FECHAINI,\r\n       MAX(sadi_movimiento.FECHA) AS FECHAFIN,\r\n       SUM(sadi_movimiento.RETIRO) AS RETIROS,\r\n       SUM(sadi_movimiento.deposito) AS DEPOSITOS,\r\n       sum(deposito) - sum(retiro) AS SALDO\r\nFROM sadi_movimiento,\r\n     sadi_cuenta_banco,\r\n     condominio\r\nWHERE sadi_cuenta_banco.id = sadi_movimiento.cuenta_banco_id\r\n  AND FECHA >= \'2016-01-01\'\r\n  AND FECHA <= \'2018-07-31\'\r\n  AND sadi_cuenta_banco.condominio_id = condominio.id\r\nGroup by 1,2,3\r\norder by 4\r\n','Ingresos Egresos Por Mes SadiCarnot 10','2018-03-14 18:50:17.805321','2018-08-25 17:09:22.321045',1,0),(14,'C SADI CARNOT Depositos y retiros por mes','SELECT nombre,\r\n       cuenta,\r\n       date_format(fecha,\'%m-%Y\') AS mes,\r\n       MIN(sadi_movimiento.FECHA) AS fec_ini,\r\n       MAX(sadi_movimiento.FECHA) AS fec_fin,\r\n       SUM(sadi_movimiento.deposito) AS depositos,\r\n       SUM(sadi_movimiento.retiro) AS retiros,\r\n       sum(deposito) - sum(retiro) AS diferencia\r\nFROM sadi_movimiento,\r\n     sadi_cuenta_banco,\r\n     periodo,\r\n     condominio\r\nWHERE sadi_cuenta_banco.id = sadi_movimiento.cuenta_banco_id\r\n  AND FECHA >= periodo.fecha_inicial\r\n  AND FECHA <= periodo.fecha_final\r\n  AND sadi_cuenta_banco.condominio_id = periodo.condominio_id\r\n  AND sadi_cuenta_banco.condominio_id = condominio.id\r\nGROUP BY 1,\r\n         2,\r\n         3','C SADI CARNOT Depositos y retiros por mes','2018-04-06 19:50:34.267858','2018-08-06 19:38:22.894587',1,0),(15,'no identificados terraza','SELECT m.*\r\nFROM olimpo_movimiento m, olimpo_detalle_movimiento d, cuenta_contable c, olimpo_condomino con\r\nWHERE m.id = d.movimiento_id\r\nand d.cuenta_contable_id = c.id\r\nand m.fecha >= \'2017-01-01\'\r\nand m.fecha <= \'2018-05-31\'\r\nand c.num_cuenta = \'411202\'\r\nand con.id = m.condomino_id\r\nand con.depto = \'0000\'\r\norder by 1','','2018-04-10 04:12:22.544693','2018-06-06 17:25:24.192117',1,0),(16,'no identificados cuotas olimpo','SELECT m.*\r\nFROM olimpo_movimiento m, olimpo_condomino con\r\nWHERE m.fecha >= \'2016-01-01\'\r\nand m.fecha <= \'2018-07-31\'\r\nand con.id = m.condomino_id\r\nand m.deposito > 0 \r\nand con.depto = \'0000\'\r\norder by 1','','2018-04-10 05:03:58.241255','2018-08-09 23:52:11.531321',1,0),(17,'no identificados cuotas sadi','SELECT m.*\r\nFROM sadi_movimiento m, sadi_condomino con\r\nWHERE m.fecha >= \'2018-05-01\'\r\nand m.fecha <= \'2018-05-31\'\r\nand con.id = m.condomino_id\r\nand m.deposito > 0 \r\nand con.depto = \'0000\'\r\norder by 1','','2018-04-10 22:48:07.233184','2018-06-11 23:35:18.844254',1,0),(18,'cuentas','select * from sadi_cuenta_banco','','2018-05-30 17:41:30.023164','2018-05-30 17:41:30.155792',1,0),(19,'PAGOS TERRAZA POR MES','SELECT date_format(fecha,\'%m-%Y\') AS mes, c.descripcion, sum(d.monto)\r\nFROM olimpo_movimiento m, olimpo_detalle_movimiento d, cuenta_contable c, olimpo_condomino con\r\nWHERE m.id = d.movimiento_id\r\nand d.cuenta_contable_id = c.id\r\nand m.fecha >= \'2017-01-01\'\r\nand m.fecha <= \'2018-06-30\'\r\nand c.num_cuenta = \'411202\'\r\nand con.id = m.condomino_id\r\ngroup by 1,2\r\norder by 1','','2018-06-06 18:03:26.273286','2018-07-08 02:35:31.481295',1,0),(20,'movimientos por condominio SADI','SELECT depto as DEPTO,	 \r\n       clabe AS CUENTA,\r\n       date_format(fecha,\"%m-%Y\") as MES,\r\n       sadi_movimiento.FECHA AS FECHA,\r\n       sadi_movimiento.deposito AS DEPOSITO,\r\n       tipo_movimiento.descripcion as TIPO,\r\n       sadi_movimiento.descripcion as DESCRIPCION\r\nFROM sadi_movimiento,\r\n     sadi_cuenta_banco,\r\n     sadi_condomino,\r\n     condominio,\r\n     tipo_movimiento\r\nWHERE sadi_cuenta_banco.id = sadi_movimiento.cuenta_banco_id\r\n  AND FECHA >= \'2016-01-01\'\r\n  AND FECHA <= \'2018-05-31\'\r\n  AND sadi_cuenta_banco.condominio_id = condominio.id\r\n  AND sadi_movimiento.condomino_id = sadi_condomino.id\r\n  AND sadi_movimiento.tipo_movimiento_id = tipo_movimiento.id\r\n  AND sadi_movimiento.deposito > 0\r\norder by 4\r\n','','2018-06-08 16:49:08.782330','20