    ','','2018-07-23 19:10:00.237171','2018-08-13 05:15:50.766479',1,0),(24,'Sadi 10 cuotas por departamento','select c.num_cuenta as Cuenta, c.descripcion as Descripcion, \r\n       min(fecha) as inicio, max(fecha) as final,\r\n       sum(haber) as Debe, sum(debe) as Haber\r\nfrom cuenta_contable c, condominio co,\r\n     sadi_condomino d, sadi_asiento m, periodo p\r\nwhere m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'SADICARNOT\'\r\nand   d.depto = $$depto$$\r\nand   m.cuenta_contable_id = c.id\r\ngroup by 1,2\r\nunion \r\nselect c.num_cuenta as Cuenta, c.descripcion as Descripcion, \r\n       min(fecha) as inicio, max(fecha) as final,\r\n       0 as Debe, sum(dm.monto) as Haber\r\nfrom cuenta_contable c, sadi_detalle_movimiento dm, condominio co,\r\n     sadi_condomino d, sadi_movimiento m, periodo p\r\nwhere c.id = dm.cuenta_contable_id\r\nand   m.id = dm.movimiento_id\r\nand   m.condomino_id = d.id\r\nand   m.fecha >= fecha_inicial\r\nand   m.fecha <= fecha_final\r\nand   p.condominio_id = co.id\r\nand   co.nombre = \'SADICARNOT\'\r\nand   d.depto = $$depto$$\r\ngroup by 1,2\r\norder by 1,2','Cuotas por departamento para reporte de estado de cuenta','2018-08-25 17:46:45.014106','2018-08-25 17:48:34.339526',1,0);
