    NO SQL
BEGIN 

 DECLARE lcRetorno VARCHAR(512); 
 DECLARE lnEntero INT;
 DECLARE lnCentavos INT;	

 set lnEntero = floor(cantidad);
 set lcRetorno = cantidadletras(lnEntero);

 set lnCentavos = (cantidad - lnEntero) * 100;
 


 RETURN CONCAT(lcRetorno,' PESOS ', lpad(format(lnCentavos,'00'),2,'00') ,'/100 M.N.');	

END ;;
