CREATE DEFINER=`ciecv31`@`%` PROCEDURE `saldo_movimientos_depto`(IN `DEPTO` VARCHAR(4))
    NO SQL
BEGIN

  DECLARE v_num INT;
  DECLARE v_num1 INT;
  DECLARE v_fecha DATE;
  DECLARE v_tipo VARCHAR(30);
  DECLARE v_desc VARCHAR(100);
  DECLARE v_cond VARCHAR(50);
  DECLARE v_cargo DECIMAL(10,2);	
  DECLARE v_abono DECIMAL(10,2);	
  DECLARE v_saldo DECIMAL(10,2);	
  DECLARE v_inicial DECIMAL(10,2);	

  DECLARE done INT DEFAULT FALSE;
  DECLARE csr CURSOR FOR 
    SELECT olimpo_movimiento.id as Num,
       fecha AS fecha,
       tipo_movimiento.descripcion AS tipo,
       olimpo_movimiento.descripcion AS descripcion,
       CONCAT(olimpo_condomino.depto,' ',
       olimpo_condomino.propietario) as Condomino, 
       retiro,
       deposito
    FROM olimpo_movimiento,
       tipo_movimiento,
       olimpo_condomino,
       condominio
    WHERE olimpo_movimiento.tipo_movimiento_id = tipo_movimiento.id
    AND olimpo_movimiento.condomino_id = olimpo_condomino.id
    and olimpo_condomino.condominio_id = condominio.id
    and olimpo_condomino.depto = DEPTO
	UNION
    SELECT max(olimpo_asiento.id) as Num,
       max(fecha) AS fecha,
        tipo_movimiento.descripcion AS tipo,
        olimpo_asiento.descripcion AS descripcion,
        CONCAT(olimpo_condomino.depto,' ',olimpo_condomino.propietario) as Condomino, 
       sum(haber) as haber,
       sum(debe) as debe
	FROM olimpo_asiento,
       tipo_movimiento,
       olimpo_condomino,
       condominio
	WHERE olimpo_asiento.tipo_movimiento_id = tipo_movimiento.id
  	AND olimpo_asiento.condomino_id = olimpo_condomino.id
    and olimpo_condomino.condominio_id = condominio.id
    and olimpo_condomino.depto = DEPTO
    and olimpo_asiento.tipo_movimiento_id = 27
    group by 3,4,5
    UNION
	SELECT olimpo_asiento.id as Num,
       fecha AS fecha,
        tipo_movimiento.descripcion AS tipo,
        olimpo_asiento.descripcion AS descripcion,
        CONCAT(olimpo_condomino.depto,' ',olimpo_condomino.propietario) as Condomino, 
       haber,
       debe
	FROM olimpo_asiento,
       tipo_movimiento,
       olimpo_condomino,
       condominio
	WHERE olimpo_asiento.tipo_movimiento_id = tipo_movimiento.id
  	AND olimpo_asiento.condomino_id = olimpo_condomino.id
    and olimpo_condomino.condominio_id = condominio.id
    and olimpo_condomino.depto = DEPTO
    and olimpo_asiento.tipo_movimiento_id <> 27
	ORDER BY 2,1;

  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

  SET v_inicial = 0.0;	
  SET v_saldo = 0.0;
  SET v_num1 = 0;

  CREATE TEMPORARY TABLE IF NOT EXISTS movtos (
    `id` INT NOT NULL,
    `fecha` DATE NOT NULL,
    `tipo` VARCHAR(30) NOT NULL,
    `descripcion` VARCHAR(70) NOT NULL,
    `condomino` VARCHAR(40) NOT NULL, 
    `cargo` DECIMAL(10,2) NOT NULL,  
    `abono` DECIMAL(10,2) NOT NULL,    
    `saldo` DECIMAL(10,2) NOT NULL    
  ); 

  OPEN csr;
read_loop: LOOP
    FETCH csr INTO v_num, v_fecha, v_tipo, v_desc,
                   v_cond,v_cargo, v_abono;


	IF done THEN
      LEAVE read_loop;
    END IF;

    SET v_saldo = v_saldo + v_cargo - v_abono;
    SET v_num1 = v_num1 + 1; 

	insert into movtos
	SELECT v_num1, v_fecha, RPAD(v_tipo,30,' ') AS TIPO, 
            RPAD(v_desc,70,' ') AS DESCRIPION, 
            RPAD(v_cond,40,' ') AS CONDOMINO, 
            v_cargo, v_abono, v_saldo;

  END LOOP;
  CLOSE csr;

  select id, fecha, tipo, descripcion, condomino, cargo, abono, saldo
  from movtos;	

END ;;
